int32_t wiki_count(void)
{
	return sizeof(wiki_entries) / sizeof(struct wiki_entry);
}

const struct wiki_entry *wiki_get_entries(void)
{
	return wiki_entries;
}

static char *wiki_data_decompressed = NULL;

void wiki_get_data(const char **data, size_t *data_len, size_t *data_olen)
{
	*data = wiki_data;
	*data_len = wiki_data_len;
	*data_olen = wiki_data_olen;
}

void webif_wiki_prepare(void)
{
	if(wiki_data_decompressed) return;
	const char *data;
	size_t data_len, data_olen;
	wiki_get_data(&data, &data_len, &data_olen);
	wiki_data_decompressed = malloc(data_olen);
	if(!wiki_data_decompressed)
	{
		cs_log("wiki: cannot allocate %zu bytes for decompression", data_olen);
		return;
	}
	lzo_uint new_len = data_olen;
	int r = lzo1x_decompress_safe((uint8_t *)data, data_len, (uint8_t *)wiki_data_decompressed, &new_len, NULL);
	if(r == LZO_E_OK && new_len == data_olen)
	{
		cs_log("wiki: decompressed %zu bytes back into %zu bytes", data_len, data_olen);
	}
	else
	{
		cs_log("wiki: decompression failed: %d", r);
		free(wiki_data_decompressed);
		wiki_data_decompressed = NULL;
	}
}

void webif_wiki_free(void)
{
	if(wiki_data_decompressed)
	{
		free(wiki_data_decompressed);
		wiki_data_decompressed = NULL;
	}
}

char *wiki_get_decompressed_data(void)
{
	return wiki_data_decompressed;
}

const char *wiki_get_help(const char *config, const char *section, const char *param)
{
	if(!wiki_data_decompressed) return NULL;
	int32_t i, count = wiki_count();
	const char *fallback = NULL;
	for(i = 0; i < count; i++)
	{
		const char *e_config = wiki_data_decompressed + wiki_entries[i].config_ofs;
		const char *e_section = wiki_data_decompressed + wiki_entries[i].section_ofs;
		const char *e_param = wiki_data_decompressed + wiki_entries[i].param_ofs;
		if(strcmp(e_config, config) == 0 && strcmp(e_param, param) == 0)
		{
			if(section && section[0] && strcmp(e_section, section) == 0)
				return wiki_data_decompressed + wiki_entries[i].text_ofs;
			if(!fallback)
				fallback = wiki_data_decompressed + wiki_entries[i].text_ofs;
		}
	}
	return fallback;
}

int8_t wiki_get_status(const char *config, const char *section, const char *param)
{
	if(!wiki_data_decompressed) return -1;
	int32_t i, count = wiki_count();
	int8_t fallback = -1;
	for(i = 0; i < count; i++)
	{
		const char *e_config = wiki_data_decompressed + wiki_entries[i].config_ofs;
		const char *e_section = wiki_data_decompressed + wiki_entries[i].section_ofs;
		const char *e_param = wiki_data_decompressed + wiki_entries[i].param_ofs;
		if(strcmp(e_config, config) == 0 && strcmp(e_param, param) == 0)
		{
			if(section && section[0] && strcmp(e_section, section) == 0)
				return wiki_entries[i].status;
			if(fallback < 0)
				fallback = wiki_entries[i].status;
		}
	}
	return fallback;
}

